import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import NavbarComponent from './components/NavbarComponent';
import FooterComponent from './components/FooterComponent';
import RegisterUserComponent from './components/RegisterUserComponent'; // Ensure this import is correct
import DashboardComponent from './components/DashboardComponent';
import LoginComponent from './components/LoginComponent';
import ProfileComponent from './components/ProfileComponent';
import DynamicFormComponent from './components/DynamicFormComponent';
import ViewFormComponent from './components/ViewFormComponent';
import ContactComponent from './components/ContactComponent';

const App = () => {
  return (
    <Router>
      <NavbarComponent />
      <div className="content">
        <Switch>
          <Route path="/login" component={LoginComponent} />
          <Route path="/profile" component={ProfileComponent} />
          <Route path="/dashboard" component={DashboardComponent} />
          <Route path="/form/:formType/:id" component={DynamicFormComponent} />
          <Route path="/form/view/:formType/:id" component={ViewFormComponent} />
          <Route path="/contact" component={ContactComponent} />
          <Route path="/register" component={RegisterUserComponent} /> {/* Add this route */}
        </Switch>
      </div>
      <FooterComponent />
    </Router>
  );
};

export default App;
